import { ThemeOptions } from '@mui/material/styles';
import { useState } from 'react';

export const themeOptions = (props) => {
  const [mode, setMode] = useState(props);

  if(props.setMode && typeof props.setMode === 'string') {
    setMode(props.setMode)
  }

  return ({
    palette: {
      mode: mode,
      primary: {
        main: '#7c4dff',
      },
      secondary: {
        main: '#f50057',
      },
    },
  })
};
